import { Info } from 'lucide-react'
import React from 'react'

function AddDocumentLink(props) {
  return (
    <div className="w-full flex justify-center items-center mt-5  transition-all ease-in-out duration-300 comeDown">
    <div className="bg-white upCard border w-full mx-20 flex items-center justify-center">
          <h2 className='flex felx-row gap-2 text-xl items-center bg-red-300 p-2 rounded-xl'><Info /> Instructions</h2>
    </div>
  </div>
  )
}

export default AddDocumentLink
